import React from 'react';
import web from '../src/Images/1.jpg'
import { NavLink } from 'react-router-dom';
import Comon from './Comon';

const Home = () => {
    return (
        <>
            <Comon
                name="Grow your business with"
                imgsrc={web}
                visit="/servi"
                btnname="Contact Now"
            ></Comon>
        </>
    );
};

export default Home;
